import Logo from "./Images/Logo.jpg"

function About() {
    return(
        <div id="about">
            <div>
                <img src={Logo} style = {{height: '50px', width: '50px', borderRadius:'50%', marginTop: '40px'}}></img>
            </div>
        </div>
    )
}

export default About;
